                    <a href="https://rainbowangles.com/#/">Rainbow Angles</a>
                    <p>Rainbow Angles is a website created to help players of the video game Rainbow Six Siege 
                        improve their knowledge of the game and allow them blah blah balh
                    </p>
                    <a className=""></a>
                </div>
            </div>
        );
    }
}

export default Projects;
